<h3 smss-form-model="SEMOSS Wellness Initiative 2020">{{item.model}}</h3>
<div smss-form-model="Use this form to log your daily steps, water intake, and exercise minutes!" class="smss-text" style="white-space: normal; font-weight: bold;">{{item.model}}</div>
<hr>
<div smss-form-model="Name:" class="smss-text" style="text-align: center; width: 10%; display: inline-block;">{{item.model}}</div>
<smss-input ng-model="form.dataModel.Participant_Name.selected" style="display: inline-block; width: 40%; border-bottom-style: dotted;"></smss-input>
<div smss-form-model="Date:" class="smss-text" style="text-align: center; width: 10%; display: inline-block;">{{item.model}}</div>
<smss-date-picker model="form.dataModel.Date.selected" format="YYYY-MM-DD" style="width: 40%; display: inline-block; border-bottom-style: dotted;"></smss-date-picker>
<hr>
<div smss-form-model="Steps:" class="smss-text" style="text-align: center; width: 33%; display: inline-block;">{{item.model}}</div>
<div smss-form-model="Minutes Exercised:" class="smss-text" style="text-align: center; width: 34%; display: inline-block;">{{item.model}}</div>
<div smss-form-model="Water Consumed (in ounces):" class="smss-text" style="text-align: center; width: 33%; display: inline-block;">{{item.model}}</div>
<smss-input type="number" ng-model="form.dataModel.Steps.selected" style="width: 33%; display: inline-block; border-style: outset;"></smss-input>
<smss-input type="number" ng-model="form.dataModel.Minutes_Exercised.selected" style="width: 34%; display: inline-block; border-style: outset;"></smss-input>
<smss-input type="number" ng-model="form.dataModel.Water_Consumed_Oz.selected" style="width: 33%; display: inline-block; border-style: outset;"></smss-input>
<hr>
<div smss-form-model="Exercise Description (optional):" class="smss-text" style="text-align: center; width: 25%; display: inline-block;">{{item.model}}</div>
<smss-textarea ng-model="form.dataModel.Exercise_Description.selected" placeholder="Use this space to document any further details about workouts or other fitness goals." style="width: 75%; display: inline-block;"></smss-textarea>
<hr>
<smss-input type="number" ng-model="form.dataModel.WELLNESS_UNIQUE_ROW_ID.selected" style="display: none;"></smss-input>
<div smss-form-model="Submit" class="form-builder__submit"><smss-btn class="smss-btn--primary" ng-click="form.runPixel(form.pixelModel.Insert.pixel)">{{item.model}}</smss-btn></div>
